AIME.process_docs:
def process_docs(dataset: datasets.Dataset) -> datasets.Dataset:
    def _process_doc(doc: dict) -> dict:
        out_doc = {
            "problem": doc["problem"],
            "solution": doc["solution"],
            "answer": doc["answer"],
        }
        return out_doc

    return dataset.map(_process_doc)

