AIME.process_results:
def process_results(doc: dict, results: List[str]) -> Dict[str, int]:
    retval = 0

    boxed_answer = last_boxed_only_string(results[0])   
    if boxed_answer is not None:
        if is_equiv(remove_boxed(boxed_answer), doc["answer"]):
            retval = 1

    results_metrics = {
        "exact_match": retval,
    }
    return results_metrics

